import json
import pandas as pd
import numpy as np
from scipy.interpolate import interp1d

# Load the climateMeasurements.xlsx file and extract the relevant columns
def load_climate_measurements(file_path):
    try:
        climate_data = pd.read_excel(file_path)
        return climate_data
    except Exception as e:
        print(f"Error loading climate measurements: {e}")

# Load the radiocarbon_database_regional.xlsx file and extract the relevant columns
def load_radiocarbon_database(file_path):
    try:
        radiocarbon_data = pd.read_excel(file_path)
        return radiocarbon_data
    except Exception as e:
        print(f"Error loading radiocarbon database: {e}")

# Merge the two datasets based on the location (Maltese area) and time
def merge_datasets(climate_data, radiocarbon_data):
    try:
        # Assuming 'Location' and 'Time' are the column names for location and time
        merged_data = pd.merge(climate_data, radiocarbon_data, on=['Location', 'Time'])
        return merged_data
    except Exception as e:
        print(f"Error merging datasets: {e}")

# Interpolate the Potassium values between samples and calculate the average
def interpolate_and_average(merged_data):
    try:
        # Assuming 'Potassium' is the column name for Potassium values
        potassium_values = merged_data['Potassium']
        time_values = merged_data['Time']

        # Interpolate Potassium values between samples
        f = interp1d(time_values, potassium_values, kind='linear', fill_value="extrapolate")

        # Calculate the average Potassium value
        average_potassium = np.mean(f(time_values))

        return round(average_potassium, 4)
    except Exception as e:
        print(f"Error interpolating and averaging: {e}")

# Main function
def main():
    climate_file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/climateMeasurements.xlsx'
    radiocarbon_file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/radiocarbon_database_regional.xlsx'

    climate_data = load_climate_measurements(climate_file_path)
    radiocarbon_data = load_radiocarbon_database(radiocarbon_file_path)

    merged_data = merge_datasets(climate_data, radiocarbon_data)

    average_potassium = interpolate_and_average(merged_data)

    print(json.dumps({
        "subtask-1": "Climate measurements loaded",
        "subtask-2": "Radiocarbon database loaded",
        "subtask-3": "Datasets merged",
        "subtask-4": "Potassium values interpolated and averaged",
        "main-task": average_potassium
    }, indent=4))

if __name__ == "__main__":
    main()

