import json
import pandas as pd

# Read the climateMeasurements.xlsx file and handle any missing values or inconsistent data types.
def read_data(file_path):
    try:
        data = pd.read_excel(file_path)
        return data
    except Exception as e:
        print(f"Error reading file: {e}")

# Calculate the difference in the wet-dry index for each year compared to the previous year.
def calculate_difference(data):
    try:
        data['Year'] = pd.to_numeric(data['Year'])
        data['Wet-Dry Index'] = pd.to_numeric(data['Wet-Dry Index'])
        data.sort_values(by='Year', inplace=True)
        data['Difference'] = data['Wet-Dry Index'].diff()
        return data
    except Exception as e:
        print(f"Error calculating difference: {e}")

# Determine the number of years with an increasing wet-dry index.
def count_increasing_years(data):
    try:
        increasing_years = data[data['Difference'] > 0].shape[0]
        total_years = data.shape[0] - 1  # subtract 1 because we can't compare the first year to a previous year
        return increasing_years, total_years
    except Exception as e:
        print(f"Error counting increasing years: {e}")

# Calculate the percentage of years with an increasing wet-dry index.
def calculate_percentage(increasing_years, total_years):
    try:
        percentage = (increasing_years / total_years) * 100
        return round(percentage, 2)
    except Exception as e:
        print(f"Error calculating percentage: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/climateMeasurements.xlsx'
    data = read_data(file_path)
    data = calculate_difference(data)
    increasing_years, total_years = count_increasing_years(data)
    percentage = calculate_percentage(increasing_years, total_years)

    print(json.dumps(
        {
            "subtask-1": "Data read successfully",
            "subtask-2": "Difference calculated successfully",
            "subtask-3": "Increasing years counted successfully",
            "subtask-4": "Percentage calculated successfully",
            "main-task": percentage
        }, indent=4))

if __name__ == "__main__":
    main()

