import json
import pandas as pd

# Load the worldcities.csv file
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Handle missing values and inconsistent data types
def handle_data_issues(data):
    try:
        # Check for missing values
        if data.isnull().values.any():
            print("Missing values found. Filling with mean for numerical columns and mode for categorical columns.")
            for col in data.columns:
                if data[col].dtype == 'object':
                    data[col] = data[col].fillna(data[col].mode()[0])
                else:
                    data[col] = data[col].fillna(data[col].mean())

        # Check for inconsistent data types
        for col in data.columns:
            if data[col].dtype == 'object':
                try:
                    data[col] = pd.to_numeric(data[col])
                except:
                    pass

        return data
    except Exception as e:
        print(f"Error handling data issues: {e}")

# Filter cities that are contained in both the southern and western hemispheres
def filter_cities(data):
    try:
        # Assuming latitude and longitude columns are named 'lat' and 'lon'
        southern_hemisphere = data['lat'] < 0
        western_hemisphere = data['lon'] < 0
        filtered_data = data[southern_hemisphere & western_hemisphere]
        return filtered_data
    except Exception as e:
        print(f"Error filtering cities: {e}")

# Find the city with the highest population
def find_highest_population_city(data):
    try:
        # Assuming population column is named 'population'
        highest_population_city = data.loc[data['population'].idxmax()]
        return highest_population_city
    except Exception as e:
        print(f"Error finding highest population city: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/worldcities.csv'
    data = load_data(file_path)
    data = handle_data_issues(data)
    filtered_data = filter_cities(data)
    highest_population_city = find_highest_population_city(filtered_data)

    answer = {
        "subtask-1": "Handled missing values and inconsistent data types",
        "subtask-2": "Filtered cities that are contained in both the southern and western hemispheres",
        "subtask-3": "Found the city with the highest population",
        "main-task": highest_population_city.to_dict()
    }

    print(json.dumps(answer, indent=4))

if __name__ == "__main__":
    main()

