        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# For each modern city, find the roman city with the highest numeric rank
def find_highest_rank(data):
    try:
        # Assuming the data has columns 'modern_city', 'roman_city', and 'rank'
        highest_ranks = {}
        for modern_city in data['modern_city'].unique():
            city_data = data[data['modern_city'] == modern_city]
            highest_rank = city_data['rank'].max()
            roman_city = city_data[city_data['rank'] == highest_rank]['roman_city'].iloc[-1]
            highest_ranks[modern_city] = roman_city
        return highest_ranks
    except Exception as e:
        print(f"Error finding highest ranks: {e}")

# Report the ancient toponym for each modern city
def report_ancient_toponym(highest_ranks):
    try:
        ancient_toponyms = {modern_city: roman_city for modern_city, roman_city in highest_ranks.items()}
        return ancient_toponyms
    except Exception as e:
        print(f"Error reporting ancient toponyms: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/roman_cities.csv'
    data = load_data(file_path)
    highest_ranks = find_highest_rank(data)
    ancient_toponyms = report_ancient_toponym(highest_ranks)
    print(json.dumps({"main-task": ancient_toponyms}, indent=4))

if __name__ == "__main__":
    main()

import json
import pandas as pd

# Load the worldcities.csv file
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Calculate the average population for each country
def calculate_average_population(data):
    try:
        # Check if the required columns exist
        required_columns = ['country', 'population']
        if not all(column in data.columns for column in required_columns):
            raise ValueError("Required columns not found in the data")

        # Calculate the average population for each country
        average_population = data.groupby('country')['population'].mean().reset_index()
        return average_population
    except Exception as e:
        print(f"Error calculating average population: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/worldcities.csv'
    data = load_data(file_path)

    if data is not None:
        average_population = calculate_average_population(data)

        if average_population is not None:
            print(json.dumps(
                {
                    "subtask-1": "Data loaded successfully",
                    "subtask-2": average_population.to_dict(orient='records'),
                    "main-task": average_population.to_dict(orient='records')
                }, indent=4)
            )

if __name__ == "__main__":
    main()

import json
import pandas as pd

# Load the worldcities.csv file
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Handle missing values
def handle_missing_values(data):
    try:
        # Replace missing values with NaN
        data = data.replace(['', ' '], NaN)
        # Drop rows with missing values
        data = data.dropna()
        return data
    except Exception as e:
        print(f"Error handling missing values: {e}")

# Filter primary capitals
def filter_primary_capitals(data):
    try:
        # Assume 'capital' column indicates primary capital
        primary_capitals = data[data['capital'] == 'primary']
        return primary_capitals
    except Exception as e:
        print(f"Error filtering primary capitals: {e}")

# Get unique country names
def get_unique_country_names(data):
    try:
        # Assume 'country' column contains country names
        unique_country_names = data['country'].unique()
        return unique_country_names
    except Exception as e:
        print(f"Error getting unique country names: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/worldcities.csv'
    data = load_data(file_path)
    data = handle_missing_values(data)
    primary_capitals = filter_primary_capitals(data)
    unique_country_names = get_unique_country_names(primary_capitals)

    answer = {
        "subtask-1": "Data loaded and missing values handled",
