import json
import pandas as pd

# Load the data
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Handle potential data issues
def handle_data_issues(data):
    try:
        # Check for missing values
        if data.isnull().values.any():
            print("Missing values found. Filling with NaN.")
            data.fillna("NaN", inplace=True)

        # Check for inconsistent data types
        for col in data.columns:
            if data[col].dtype == 'object':
                try:
                    data[col] = data[col].astype(str)
                except Exception as e:
                    print(f"Error converting {col} to string: {e}")

        return data
    except Exception as e:
        print(f"Error handling data issues: {e}")

# Extract unique country names
def extract_unique_country_names(data):
    try:
        # Assuming the country names are in a column named 'country'
        country_names = data['country'].unique()
        return country_names
    except Exception as e:
        print(f"Error extracting unique country names: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/conflict_brecke.csv'
    data = load_data(file_path)
    data = handle_data_issues(data)
    country_names = extract_unique_country_names(data)

    print(json.dumps(
        {
            "subtask-1": "Data loaded and handled",
            "subtask-2": country_names.tolist(),
            "main-task": country_names.tolist()
        }, indent=4
    ))

if __name__ == "__main__":
    main()

import json
import pandas as pd

# Load the conflict_brecke.csv file and handle missing values.
def load_data(file_path):
    try:
        data = pd.read_csv(file_path)
        return data
    except Exception as e:
        print(f"Error loading data: {e}")

# Filter the conflicts to only include those between 800 and 1400 AD.
def filter_conflicts(data):
    try:
        filtered_data = data[(data['Start Year'] >= 800) & (data['Start Year'] <= 1400)]
        return filtered_data
    except Exception as e:
        print(f"Error filtering conflicts: {e}")

# Extract the pairs of countries involved in conflicts.
def extract_country_pairs(data):
    try:
        country_pairs = []
        for index, row in data.iterrows():
            if pd.notna(row['Side A']) and pd.notna(row['Side B']):
                country_pairs.append((row['Side A'], row['Side B']))
            elif pd.notna(row['Side A']):
                country_pairs.append((row['Side A'], row['Side A']))
        return country_pairs
    except Exception as e:
        print(f"Error extracting country pairs: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/conflict_brecke.csv'
    data = load_data(file_path)
    filtered_data = filter_conflicts(data)
    country_pairs = extract_country_pairs(filtered_data)

    answer = {
        "subtask-1": "Data loaded successfully",
        "subtask-2": "Conflicts filtered successfully",
        "subtask-3": "Country pairs extracted successfully",
        "main-task": country_pairs
    }

    print(json.dumps(answer, indent=4))

if __name__ == "__main__":
    main()

import json
import pandas as pd

# Load the conflict data from the csv file and handle missing values.
def load_conflict_data(file_path):
    try:
        conflict_data = pd.read_csv(file_path)
        conflict_data = conflict_data.dropna()  # Remove rows with missing values
        return conflict_data
    except Exception as e:
        print(f"Error loading conflict data: {e}")

# Filter the conflicts to only include those between 800 and 1400 AD.
def filter_conflicts(conflict_data):
    try:
        filtered_conflicts = conflict_data[(conflict_data['start_year'] >= 800) & (conflict_data['end_year'] <= 1400)]
        return filtered_conflicts
    except Exception as e:
        print(f"Error filtering conflicts: {e}")

# Remove overlaps by identifying conflicts with the same actors and duration.
def remove_overlaps(conflict_data):
    try:
        # Assuming 'actor1', 'actor2', 'start_year', and 'end_year' are columns in the conflict data
        conflict_data['conflict_id'] = conflict_data.apply(lambda row: f"{row['actor1']}_{row['actor2']}_{row['start_year']}_{row['end_year']}", axis=1)
        unique_conflicts = conflict_data.drop_duplicates(subset='conflict_id')
        return unique_conflicts
    except Exception as e:
        print(f"Error removing overlaps: {e}")

# Count the number of remaining conflicts.
def count_conflicts(conflict_data):
    try:
        conflict_count = len(conflict_data)
        return conflict_count
    except Exception as e:
        print(f"Error counting conflicts: {e}")

# Main function
def main():
    file_path = '/orcd/home/002/gerarvit/Kramabench/data/archeology/input/conflict_brecke.csv'
    conflict_data = load_conflict_data(file_path)
    filtered_conflicts = filter_conflicts(conflict_data)
    unique_conflicts = remove_overlaps(filtered_conflicts)
    conflict_count = count_conflicts(unique_conflicts)

    print(json.dumps({
        "subtask-1": "Conflict data loaded",
        "subtask-2": "Conflicts filtered",
        "subtask-3": "Overlaps removed",
        "subtask-4": "Conflicts counted",
        "main-task": conflict_count
    }, indent=4))

if __name__ == "__main__":
    main()
